// React
import React, { useState, Fragment } from "react";

// Third part
import { Table } from "antd";
import { DeleteFilled, EditFilled } from "@ant-design/icons";
import { column } from "./column";

const { Column, ColumnGroup } = Table;

const PersonalTable = ({ data }) => {
  return (
    <Table
      bordered
      columns={column}
      dataSource={data}
      bordered
      size="middle"
      scroll={{ x: 1300 }}
    >
      <ColumnGroup title="Employee Info">
        <Column
          title="First name"
          dataIndex="first_name"
          fixed="left"
          width="20px"
          sorter={(a, b) => a.first_name.length - b.first_name.length}
        />
        <Column
          title="Last name"
          dataIndex="last_name"
          fixed="left"
          width="20px"
          sorter={(a, b) => a.first_name.length - b.first_name.length}
        />
        <Column
          title="age"
          dataIndex="age"
          width="50px"
          sorter={(a, b) => a.age - b.age}
        />
        <Column
          title="gender"
          dataIndex="gender"
          filters={[
            { text: "Male", value: "Male" },
            { text: "Female", value: "Female" }
          ]}
          width="50px"
          filterMultiple={false}
          onFilter={(value, record) => record.gender.indexOf(value) === 0}
        />
        <Column
          title="Address"
          dataIndex="address"
          filters={[
            {
              text: "Huangpu",
              value: "Huangpu"
            },
            {
              text: "Changning",
              value: "Changning"
            },
            {
              text: "Jing'an",
              value: "Jing'an"
            },
            {
              text: "Putuo",
              value: "Putuo"
            },
            {
              text: "Hongkou",
              value: "Hongkou"
            },
            {
              text: "Yangpu",
              value: "Yangpu"
            },
            {
              text: "Minhang",
              value: "Minhang"
            },
            {
              text: "Baoshan",
              value: "Baoshan"
            },
            {
              text: "Jiading",
              value: "Jiading"
            },
            ,
            {
              text: "Pudong",
              value: "Pudong"
            },
            ,
            {
              text: "Jinshan",
              value: "Jinshan"
            },
            ,
            {
              text: "Songjiang",
              value: "Songjiang"
            },
            ,
            {
              text: "Qingpu",
              value: "Qingpu"
            },
            ,
            {
              text: "Fengxian",
              value: "Fengxian"
            },
            ,
            {
              text: "Chongming",
              value: "Chongming"
            }
          ]}
          width="50px"
          onFilter={(value, record) => record.address.indexOf(value) === 0}
        />
      </ColumnGroup>
    </Table>
  );
};

export default PersonalTable;
